import React from "react";
import Header from "./components/Header";
import { Container } from "react-bootstrap";
import { Routes, Route } from "./Routes";

function App() {
  return (
    <div>
      <Header />
      <Container>
        <Routes>
          <Route path='/' exact={true} element={<Home />} />
        </Routes>
      </Container>
    </div>
  );
}

export default App;
